var title_f43_17_44311="Plaque features responsible for acute thrombosis";
var content_f43_17_44311=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F72618&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F72618&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 619px\">",
"   <div class=\"ttl\">",
"    Plaque features responsible for acute thrombosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 599px; height: 348px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Coronary plaque features responsible for acute thrombosis, which comprise three different morphologies: rupture, erosion, and calcified nodules. Ruptured plaques are thin fibrous cap atheromas with luminal thrombi (Th). These lesions usually have an extensive necrotic core (NC) containing large numbers of cholesterol crystals and a thin fibrous cap (&lt;65 &micro;m) infiltrated by foamy macrophages and T lymphocytes. The fibrous cap is thinnest at the site of rupture and consists of a few collagen bundles and rare smooth muscle cells. The luminal thrombus is in communication with the lipid-rich necrotic core. Erosions occur over lesions rich in smooth muscle cells and proteoglycans. Luminal thrombi overlie areas lacking surface endothelium. The deep intima of the eroded plaque often shows extracellular lipid pools, but necrotic cores are uncommon; when present, the necrotic core does not communicate with the luminal thrombus. Inflammatory infiltrate is usually absent, but if present, is sparse and consists of macrophages and lymphocytes. Calcified nodules are plaques with luminal thrombi showing calcific nodules protruding into the lumen through a disrupted thin fibrous cap. There is absence of an endothelium at the site of the thrombus, and inflammatory cells (macrophages, T lymphocytes) are absent.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Virmani R, Kolodgie FD, Burke AP, et al. Lessons from sudden coronary death: a comprehensive morphological classification scheme for atherosclerotic lesions. Arterioscler Thromb Vasc Biol 2000; 20:1262. Copyright &copy; 2000 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
