var title_f43_17_44316="Rx serious MSSA child";
var content_f43_17_44316=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F57379&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F57379&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Parenteral antimicrobial regimens for definitive treatment of bacteremia and other serious methicillin-susceptible Staphylococcus aureus infections outside the central nervous system in children older than 30 days",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Antimicrobial regimen",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dose",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Regimens of choice",
"       </td>",
"       <td>",
"        <p>",
"         Nafcillin* &plusmn;",
"        </p>",
"        <p>",
"         Gentamicin",
"         <sup>",
"          &bull;",
"         </sup>",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Nafcillin: 150 to 200 mg/kg per day in 4 doses; maximum daily dose 4 to 12 g",
"        </p>",
"        <p>",
"         Gentamicin: 3 mg/kg per day in 3 doses for 5 days",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <p>",
"         Oxacillin* &plusmn;",
"        </p>",
"        <p>",
"         Gentamicin",
"         <sup>",
"          &bull;",
"         </sup>",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Oxacillin: 150 to 200 mg/kg per day in 4 doses; maximum daily dose 4 to 12 g",
"        </p>",
"        <p>",
"         Gentamicin: 3 mg/kg per day in 3 doses for 5 days",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"4\">",
"        Alternatives",
"       </td>",
"       <td>",
"        Cefazolin*",
"       </td>",
"       <td>",
"        100 mg/kg per day in 3 doses; maximum daily dose 4 to 6 g",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Clindamycin",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        30 to 40 mg/kg per day in 3 to 4 doses; maximum daily dose 1.2 to 2.7 g",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vancomycin",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"       <td>",
"        40 to 60 mg/kg per day in 4 doses; maximum daily dose 4 g",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ampicillin-sulbactam",
"        <sup>",
"         &sect;",
"        </sup>",
"       </td>",
"       <td>",
"        200 mg/kg of ampicillin component per day in 4 doses; maximum daily dose 8g",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Patients allergic to penicillins and cephalosporins should receive vancomycin for serious infection with methicillin-susceptible",
"     <em>",
"      Staphylococcus aureus",
"     </em>",
"     (MSSA). Clindamycin may be used if the organism is susceptible and the infection is not endovascular.",
"     <br>",
"      <font class=\"bullet\">",
"       &bull;",
"      </font>",
"      Gentamicin may be added for endocarditis, although there are no data from controlled trials to indicate that combination therapy is advantageous. It is recommended that both rifampin and gentamicin be added to nafcillin/oxacillin for MSSA prosthetic valve endocarditis. Consultation with an expert in infectious diseases may be warranted to determine which agent to use and duration of use.",
"      <br>",
"       &Delta; Clindamycin should only be used for patients with serious penicillin allergy and clindamycin-susceptible strain. It should not be used in patients with ongoing bacteremia or endocarditis.",
"       <br>",
"        <font class=\"lozenge\">",
"         &loz;",
"        </font>",
"        Only for patients with allergy to penicillins and cephalosporins.",
"        <br>",
"         &sect; Particularly for polymicrobial infections that include MSSA.",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Data from:",
"     <br>",
"      <ol>",
"       <li>",
"        Staphylococcal infections. In: Red Book: 2012 Report of the Committee on Infectious Diseases, 29",
"        <sup>",
"         th",
"        </sup>",
"        ed, Pickering LK (Ed), American Academy of Pediatrics, Elk Grove Village, IL 2012. p.653.",
"       </li>",
"       <li>",
"        American Academy of Pediatrics. Tables of antibacterial drug dosages. In: Red Book: 2012 Report of the Committee on Infectious Diseases, 29",
"        <sup>",
"         th",
"        </sup>",
"        ed, Pickering LK (Ed), American Academy of Pediatrics, Elk Grove Village, IL 2012. p.807.",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
