var title_f43_17_44317="Dx asbestos disease A";
var content_f43_17_44317=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F61308%7EPULM%2F71021&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=12\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F61308%7EPULM%2F71021&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=12\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Criteria for diagnosis of nonmalignant lung disease related to asbestos",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\" class=\"container\">",
"     <tbody>",
"      <tr>",
"       <td class=\"container\">",
"        <table cellspacing=\"0\">",
"         <tbody>",
"          <tr>",
"           <td class=\"subtitle1_single\">",
"            1986 Guidelines",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Chest film (irregular opacities)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Pathology (College of American Pathologists)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Consistent time interval",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Occupational and environmental history",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Asbestos bodies or fibers",
"           </td>",
"          </tr>",
"         </tbody>",
"        </table>",
"       </td>",
"       <td class=\"container\">",
"        <table cellspacing=\"0\">",
"         <tbody>",
"          <tr>",
"           <td class=\"subtitle1_single\">",
"            2004 Guidelines",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"sublist1_start\">",
"            Evidence of structural change, as demonstrated by one or more of the following:",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"sublist1\">",
"            Imaging methods",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"sublist1\">",
"            Histology (College of American Pathologists)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"sublist1_start\">",
"            Evidence of plausible causation, as demonstrated by one or more of the following:",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"sublist1\">",
"            Occupational and environmental history of exposure (with plausible latency)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"sublist1\">",
"            Markers of exposure (eg, plaques)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"sublist1\">",
"            Recovery of asbestos bodies in lung tissue",
"           </td>",
"          </tr>",
"         </tbody>",
"        </table>",
"       </td>",
"       <td class=\"container\">",
"        <table cellspacing=\"0\">",
"         <tbody>",
"          <tr>",
"           <td class=\"subtitle1_single\">",
"            Comparison and notes",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Demonstrates the existence of a structural lesion consistent with the effects of asbestos. The criteria outlined in the 1986 were most explicit for asbestosis.",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Chest film, HRCT, and possibly future methods based on imaging. The 1986 guidelines specified ILO classification 1/1.",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Criteria for identifying asbestosis on microscopic examination of tissue are unchanged.",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Evidence of plausible causation implies that the temporal relationship, including latency, is plausible.",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            The 2004 guidelines are not limited to lung tissue, consider the role of BAL to be established, and deemphasize fibers because they are difficult to detect and a systematic analysis for asbestos fibers is not generally available.",
"           </td>",
"          </tr>",
"         </tbody>",
"        </table>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Am J Respir Crit Care Med vol 170 pp 692, 2004; www.atsjournals.org.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Criteria for diagnosis of nonmalignant lung disease related to asbestos",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\" class=\"container\">",
"     <tbody>",
"      <tr>",
"       <td class=\"container\">",
"        <table cellspacing=\"0\">",
"         <tbody>",
"          <tr>",
"           <td class=\"subtitle1_single\">",
"            1986 Guidelines",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Rule out other causes of interstitial fibrosis or obstructive disease",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            \"Evidence of abnormal test\"",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Crackles, bilateral, not cleared by cough",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Restrictive disease",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Reduced diffusing capacity",
"           </td>",
"          </tr>",
"         </tbody>",
"        </table>",
"       </td>",
"       <td class=\"container\">",
"        <table cellspacing=\"0\">",
"         <tbody>",
"          <tr>",
"           <td class=\"subtitle1_single\">",
"            2004 Guidelines",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Exclusion of alternative diagnoses",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"sublist1_start\">",
"            Evidence of functional impairment, as demonstrated by one or more of the of following:",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"sublist1\">",
"            Signs and symptoms (including crackles)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"sublist1\">",
"            Change in ventilatory function (restrictive, obstructive patterns in context or disease history)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"sublist1\">",
"            Impaired gas exchange (eg, reduced diffusing capacity)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"sublist1\">",
"            Inflammation (eg, by bronchoalveolar lavage)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"sublist1\">",
"            Exercise testing",
"           </td>",
"          </tr>",
"         </tbody>",
"        </table>",
"       </td>",
"       <td class=\"container\">",
"        <table cellspacing=\"0\">",
"         <tbody>",
"          <tr>",
"           <td class=\"subtitle1_single\">",
"            Comparison and notes",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            The 1986 guidelines primarily addressed asbestosis but mentioned smoking as a cause of obstructive disease. Implicit in the article, however, is that nonmalignant diseases presenting similarly to asbestos-related disease should also be ruled out.",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Functional assessment is not required for diagnosis but is part of a complete evaluation. It contributes to diagnosis in defining the activity of disease and the resulting impairment.",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Signs and symptoms are not specific for diagnosis but are valuable in assessing impairment.",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            The 1986 criteria admitted the possibility of obstructive disease; the 2004 criteria address this specifically.",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            The 1986 guidelines noted possible utility of bronchoalveolar lavage and gallium scanning but considered them to be experimental techniques. The 2004 guidelines exclude gallium scanning, suggest that additional indicators of active inflammation may become useful in future.",
"           </td>",
"          </tr>",
"         </tbody>",
"        </table>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Am J Respir Crit Care Med vol 170 pp 692, 2004; www.atsjournals.org.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
